style.css:
@-moz-document url-prefix("https://start.me/") {
.widget__container {
    border-radius: 15px;
}
.search__input, .search__wrapper {
    border-radius: 10px;
}
.search__button {
     border-top-right-radius: 10px;
    border-bottom-right-radius: 10px;
}
.header-right__control {
    border-radius: 10px;
}
.header-right__button {
    border-radius: 10px;
    overflow: hidden;
}
.page-footer__toggler {
    border-top-left-radius: 10px;
    border-top-right-radius: 10px;
}
.breadcrumb__edit, .breadcrumb__button {
    border-radius: 10px;
}
}
